import React from "react";
import "./Header.css"
const Header = () =>{
    return (
        <div className="header">
         <div className="header-wrapper">
         <div  className="logo">
            <img id="lvlogo" src="https://i.pinimg.com/originals/86/75/75/867575c5faf2694b852c4cf756d5f51e.png"></img>
         </div>
         <div className="menu">
            <div className="menu-item"> Каталог</div>
            <div className="menu-item"> Избранное</div>
            <div className="menu-item"> Личный кабинет</div>
            <div className="menu-item"> Служба поддержки</div>
         </div>
         </div>
        </div>
    );
}

export default Header;
